  false,\n\t\"url\": null,\n\t\"notes\": \"This report is a summary of the results
  of botanical investigations conducted along the Atigun River, associated side channels
  and tributaries during the period 6, 7 August 1979. The work follows initial observations
  made 26-28 June 1979 after a release of crude oil from a break in the Trans-Alaska
  Pipeline near Atigun Pass. During the period 26-28 June 1979, efforts were concentrated
  on five sites as described by Pamplin (1979). This report, however, covers the results
  of visits to three of the aforementioned sites and one additional site not described
  by Pamplin (1979).\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
